-- Make sure to set Harmonie labels into comments, for already existing harbours

update location set label='FRGVC', comments='XGV' where name='Guilvinec' and LOCATION_LEVEL_FK=2;
update location set comments='CGV' where label='FRCGV' and LOCATION_LEVEL_FK=2;
update location set comments='ESB' where label='FRESB' and LOCATION_LEVEL_FK=2;
update location set comments='HSB' where label='FRHSB' and LOCATION_LEVEL_FK=2;
update location set comments='GMX' where label='FRGMX' and LOCATION_LEVEL_FK=2;
update location set comments='MMX' where label='FRMMX' and LOCATION_LEVEL_FK=2;
update location set comments='XBL' where label='FRBOL' and LOCATION_LEVEL_FK=2;
update location set comments='XDZ' where label='FRDRZ' and LOCATION_LEVEL_FK=2;
update location set comments='LCN' where label='FRRTB' and LOCATION_LEVEL_FK=2;

-- Fix new UNLOCODE
update location set label='FRDZO', name='Saint-Pierre d''Oléron' where label='FRLC5' and LOCATION_LEVEL_FK=2;


-- Insert order item
-- Insert order item

        select l.ID,
               1,
               1,
               null,
               current_timestamp
        from location l
        where l.location_level_fk=2
          and l.label like 'FR%'
          and not exists(select * from location_association where child_location_fk = L.id)
    );
commit;
